import React from 'react';
import AppLayout from "../components/AppLayout";
import Head from 'next/head';
import LoginForm from '../components/LoginForm';

const Signup = () => {
    return (
        <>
            <Head>
                <title>로그인</title>
            </Head>
            <AppLayout>
                <LoginForm />
            </AppLayout>
        </>
    );
}

export default Signup;
